import React, { Component } from 'react'
import Tabela from "../../components/tabela"

export default function albuns() {
    const objeto =
    {
        titulos:[ "tit1", "tit2"],
        linhas:[
            ["linha1", "linha1.2"],
            ["linha2", "linha2.2"]
        ]

    }



    return (
        <Tabela objeto = {objeto}/>
    )
}
